import React from "react";
import "./App.css";
import Login_form from "./login_form";
import Create_address from "./create_address";
import { Link, BrowserRouter, Route, Routes } from "react-router-dom";

class App {
  /**
   * @return {Component} Component
   */
  render() {
    return (
      <div className="App">
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Login_form></Login_form>}></Route>

            <Route
              path="/create"
              element={<Create_address></Create_address>}
            ></Route>
            <Route path="/write/test"></Route>
          </Routes>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
